import React, { createContext, useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './Login';
import Singup from './Singup';
import Payement from './Payement';
import ForgotPassword from "./ForgotPassword";
import Ticket from "./Ticket";
import Category from "./Category";
import Guest from './Guest';
import Reset from './Reset';
import WelcomeScreen from './WelcomeScreen';
import Success from './Success';
import TicketQuantityPage from './TicketQuantityPage';
import ConfirmationPage from './ConfirmationPage';
import  DoorsPage from './DoorsPage';
export const RecoveryContext = createContext();
import AuthGuard from './Authuard';

function App() {

  const [qrCode, setQrCode] = useState(null);

  return (

    <Router>
      <Routes>
        <Route path='/' element={<Login />} />
        <Route path='/singup' element={<Singup />} />
        <Route path='/payement' element={<Payement setQrCode={setQrCode}/>} />
        <Route path='/ForgotPassword' element={<ForgotPassword />} />
        <Route path='/Ticket' element={<Ticket />} />
        <Route path='/Category' element={<Category />} />
        <Route path='/Guest' element={<Guest />} />
        <Route path='/Reset' element={<Reset />} />
        <Route path='/WelcomeScreen' element={<WelcomeScreen />} />
        <Route path='/TicketQuantityPage' element={<TicketQuantityPage />} />
        <Route path='/WorldCupTicket' element={<ConfirmationPage />} />
        <Route path="/success" element={<Success qrCode={qrCode} />} />
        <Route path="/DoorsPage" element={< DoorsPage />} />

      </Routes>
    </Router>

  );
}

export default App;
